import React, { useState, useEffect } from 'react'
import "./ContactMe.css"

export default function ContactMe() {

    const [name, setname] = useState("")
    const [emailaddress, setemailaddress] = useState("")
    const [phone, setphone] = useState("")
    const [subject, setsubject] = useState("")
    const [message, setmessage] = useState()

    return (
        <div>
                        <div>
                <h1>Projects</h1>
            </div>
            <input placeholder="Name" onChange={(event) => { event.preventDefault(); setname(event.target.value) }}></input>
            <input placeholder="Email" onChange={(event) => { event.preventDefault(); setemailaddress(event.target.value) }}></input>
            <input placeholder="Phone Number" onChange={(event) => { event.preventDefault(); setphone(event.target.value) }}></input>
            <input placeholder="Subject" onChange={(event) => { event.preventDefault(); setsubject(event.target.value) }}></input>
            <textarea  placeholder="Message" onChange={(event) => { event.preventDefault(); setmessage(event.target.value) }}></textarea >
            <button onClick={() => { console.log(`${name} ${emailaddress} ${phone} ${subject} ${message} `) }}>Send</button>
        </div>
    )
}
